import React from "react";

function List() {
  return (
    <ol>
      <li>Ahemdabad</li>
      <li>Surat</li>
      <li>Gandhinagar</li>
      <li>Amreli</li>
      <li>Vadodra</li>
    </ol>
  );
}

export default List;
